 var logger={active:function(){var a=_config!=null&&_config.debug&&window.console!=null&&typeof window.console=="object";return a},activeDebugMode:function(){_config.debug=true;_config.logger.level=1},log:function(c,f){try{throw new Error()}catch(d){var b=this.parseCallStack(d.stack);if(this.activeLevel()<=2){c=c+"\t %c on "+b.file+", line "+b.line+"\t at "+(new Date()).toLocaleString()}var a="color: #777; text-align:right;float:right;font-size: 6pt;";switch(f){case"debug":console.log(c,a);break;case"info":console.info(c,a);break;case"warn":console.warn(c,a);break;case"error":console.error(c,a);break}}},debug:function(a){if(logger.active()&&this.activeLevel()<=2){this.log(a,"debug")}},info:function(a){if(logger.active()&&this.activeLevel()<=3){this.log(a,"info")}},warn:function(a){if(logger.active()&&this.activeLevel()<=4){this.log(a,"warn")}},error:function(a){if(logger.active()&&this.activeLevel()<=5){this.log(a,"error")}},trace:function(){if(logger.active()&&this.activeLevel()<=1){console.trace()}},activeLevel:function(){if(_config.logger.level==null){return 1}else{return _config.logger.level}},parseCallStack:function(a){var b=a.split("\n")[3];if(b.indexOf("http")==-1){return{file:"NULL",line:0}}b=b.substring(b.indexOf("http"));var c=b.split("/").slice(3).join("/");return{stack:a,file:c.split(":")[0],host:b.split("/")[2].split(":")[0],port:b.split("/")[2].split(":")[1],protocol:b.split(":")[0],line:c.split(":")[1],col:c.split(":")[2]}},disclaimer:function(){if(!_config||!_config.logger||!_config.logger.disclaimer){return}try{if(typeof _config.logger.messages!="undefined"){console.log("%c"+_config.logger.messages.appTitle,"font-size: 30pt; color:orange");console.log("%cSTOP !","font-size: 26pt;color:red");console.log("%c"+_config.logger.messages.consoleWarning,"font-size: 12pt;")}else{if(typeof __=="function"){console.log("%c"+__("AppTitle"),"font-size: 30pt; color:orange");console.log("%cSTOP !","font-size: 26pt;color:red");console.log("%c"+__("Console Warning"),"font-size: 12pt;")}else{console.log("%cSTOP !","font-size: 26pt;color:red");console.log("%cConsole is browser feature designed for web developpers. \nIf you have been invited to type something here, you have do it in your own responsability. It can be hacking purpose and illegal.","font-size: 12pt;")}}}catch(a){setTimeout(function(){logger.disclaimer()},500)}}};if(typeof jQuery=="function"){jQuery(document).ready(function(){setTimeout(function(){logger.disclaimer()},1500)})}else{document.addEventListener("DOMContentLoaded",function(a){setTimeout(function(){logger.disclaimer()},1500)})};